// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24 ; //current version of solidity which and work on or above this version

contract SimpleStorage{
    //Basic type : boolean , address , uint , int , bytes
    bool hasFavoriteNumber = true ;
    int256 public favoriteNumber = - 88 ; 
    string FavoriteNumberInTest = "my fav is 7" ; 
    address myAddress = 0xA5c7f43162333963149E5AC357917b37974A41f6 ;

    //function
    function Store(uint256 _favNumber) public {
        favoriteNumber = int256(_favNumber) ;
    }

    //view , pure
    function retrieve() view public returns (int256) {
        return favoriteNumber ; // favoriteNumber is accessable bcos its in main contract
    }

    //struture
    struct Person{
        uint256 favoriteNumber;
        string name; 
    }

    //dynamic array
    Person[] public people ; 

    //static array
    Person[3] public limitedPeople ; 

    //mapping (dict) to save time in finding in list and array
    mapping (string => uint256) public nameToFavoriteNumber ; 

    function addPerson (string memory _name , uint256 _favNumber) public {
        Person memory newPerson = Person(_favNumber , _name) ;
        people.push(newPerson) ;

        //or
        // people.push(Person(_favNumber , _name))

        //mapping
        nameToFavoriteNumber[_name] = _favNumber ; 
    }



}

